import React, { useState } from "react";
import styles from "./App.module.css";



function App() {
    let exercises, setExercise = useState([{ name:"chestPress",sets: [{ sno: "1", reps: "12", weight: "15kg" }] }]);
    return (
        <div>
            <div>
                {exercises.map((exercise)=>{
                    return (
                        <h2> {exercise.name}</h2>
                    )
                })}
            </div>
        </div>
    );
}

export default App;
